components.script:
var fileName = request.getHeader("CamelFileName")+"";

//controleer of filename een bepaalde waarde bevat. Op basis daarvan wordt een header gezet.

if (fileName.toUpperCase().indexOf('TROPEN')!=-1)
{ request.setHeader("gevondenSoort", "TROPEN")
}
else
if (fileName.toUpperCase().indexOf('KOUD WATER')!=-1)
{ request.setHeader("gevondenSoort", "KOUDWATER")
}
else
if (fileName.toUpperCase().indexOf('PLANTEN')!=-1)
{ request.setHeader("gevondenSoort", "PLANTEN")
}
else
if (fileName.toUpperCase().indexOf('LIVE FOOD')!=-1)
{ request.setHeader("gevondenSoort", "LIVEFOOD")
}
else
{ request.setHeader("gevondenSoort", "ONBEKEND")
}
